function generateSmartInsights(count = 5) {
    const insights = [];
    const types = [
        'trend',
        'anomaly',
        'opportunity',
        'risk',
        'achievement'
    ];
    const severities = [
        'low',
        'medium',
        'high',
        'critical'
    ];
    const categories = [
        '学习进度',
        '用户参与',
        '收入分析',
        '系统性能',
        '内容质量'
    ];
    for(let i = 1; i <= count; i++){
        const type = types[Math.floor(Math.random() * types.length)];
        const severity = severities[Math.floor(Math.random() * severities.length)];
        const category = categories[Math.floor(Math.random() * categories.length)];
        const dataPoints = [
            {
                label: '当前值',
                value: Math.floor(Math.random() * 1000) + 100,
                change: Number((Math.random() * 40 - 20).toFixed(1)),
                trend: Math.random() > 0.5 ? 'up' : 'down',
                timestamp: new Date()
            },
            {
                label: '对比值',
                value: Math.floor(Math.random() * 800) + 200,
                change: Number((Math.random() * 30 - 15).toFixed(1)),
                trend: Math.random() > 0.5 ? 'up' : 'down',
                timestamp: new Date(Date.now() - 86400000 * 7) // 一周前
            }
        ];
        const recommendations = [
            {
                id: `rec-${i}-1`,
                text: `建议优化${category}相关策略`,
                priority: severity === 'critical' ? 'high' : severity === 'high' ? 'medium' : 'low',
                estimatedImpact: `预计提升${(Math.random() * 20 + 5).toFixed(1)}%`,
                actionUrl: `/dashboard/analytics?focus=${category}`,
                actionText: '查看详情'
            }
        ];
        if (Math.random() > 0.5) {
            recommendations.push({
                id: `rec-${i}-2`,
                text: `考虑调整${category}配置参数`,
                priority: 'medium',
                estimatedImpact: `预计改善${(Math.random() * 15 + 3).toFixed(1)}%`,
                actionUrl: `/settings/${category.toLowerCase()}`,
                actionText: '配置设置'
            });
        }
        insights.push({
            id: `insight-${i}`,
            type,
            title: `${category} - ${type === 'trend' ? '趋势分析' : type === 'anomaly' ? '异常检测' : type === 'opportunity' ? '机会识别' : type === 'risk' ? '风险评估' : '成就达成'}`,
            description: `在${category}方面发现${type === 'trend' ? '重要趋势' : type === 'anomaly' ? '异常模式' : type === 'opportunity' ? '优化机会' : type === 'risk' ? '潜在风险' : '显著成就'}，需要关注`,
            severity,
            dataPoints,
            recommendations,
            timestamp: new Date(Date.now() - Math.random() * 86400000 * 7),
            category,
            tags: [
                category.toLowerCase(),
                type,
                severity
            ],
            confidence: Math.random() * 0.3 + 0.7,
            autoActionable: Math.random() > 0.3
        });
    }
    return insights.sort((a, b)=>{
        const severityOrder = {
            critical: 4,
            high: 3,
            medium: 2,
            low: 1
        };
        return severityOrder[b.severity] - severityOrder[a.severity];
    });
}
